import React from 'react';

const Contact = () => {
    return (
        <div>
            <h1>Хотите съемку?</h1>
            <h2 style={{width: 300, fontSize: 40, fontWeight: 300}}>Оставьте заявку и я свяжусь в вами в ближайщее время?</h2>
        </div>
    );
};

export default Contact;
